import React from "react";
import {Text, View} from "react-native";

const DashboardScreen = () => {
    return (
        <View>
            <Text style={{fontFamily: "Poppins", fontSize: 60}}> Dashboard Screen </Text>
        </View>
        )
}

export default DashboardScreen
